import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, AuthContext } from './context/AuthContext';
import { BookingProvider } from './context/BookingContext';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './pages/Home';
import BookingPage from './pages/BookingPage';
import './styles/global.css';

// Placeholder pages
const Tours = () => <div className="container" style={{ padding: '40px 20px' }}><h1>Tours Page - Coming Soon</h1></div>;
const About = () => <div className="container" style={{ padding: '40px 20px' }}><h1>About Page - Coming Soon</h1></div>;
const Contact = () => <div className="container" style={{ padding: '40px 20px' }}><h1>Contact Page - Coming Soon</h1></div>;
const Login = () => <div className="container" style={{ padding: '40px 20px' }}><h1>Login Page - Coming Soon</h1></div>;
const Register = () => <div className="container" style={{ padding: '40px 20px' }}><h1>Register Page - Coming Soon</h1></div>;
const Profile = () => <div className="container" style={{ padding: '40px 20px' }}><h1>Profile Page - Coming Soon</h1></div>;
const MyBookings = () => <div className="container" style={{ padding: '40px 20px' }}><h1>My Bookings Page - Coming Soon</h1></div>;

function App() {
  return (
    <AuthProvider>
      <BookingProvider>
        <Router>
          <div className="app">
            <Header />
            <main className="main-content">
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/tours" element={<Tours />} />
                <Route path="/tours/:id" element={<BookingPage />} />
                <Route path="/about" element={<About />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/profile" element={<Profile />} />
                <Route path="/my-bookings" element={<MyBookings />} />
                <Route path="*" element={<Navigate to="/" />} />
              </Routes>
            </main>
            <Footer />
          </div>
        </Router>
      </BookingProvider>
    </AuthProvider>
  );
}

export default App;
